  def test_detailed_lever_guides_l38; assert_equal("Global average calorie consumption rises to 2,330 kcal/person/day by 2050 based on trend forecast by the UNs Food and Agricultural Organisation (FAO).", worksheet.detailed_lever_guides_l38); end
